import React, { useEffect, useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { registerUser } from '../store/AuthSlice'
import { StyleFrom } from '../style/StyleForm'
import { useNavigate } from 'react-router'

function Register() {

  const StyleFrom = styled.form`
    max-width: 350px;
    width: 100%;
    margin: 2rem auto;

    h2{
        margin-bottom: 1rem;
    }

    button,input{
        height: 35px;
        width: 100%;
        padding: 7px;
        outline: none;
        border-radius: 5px;
        border: 1px solid rgb(220,220,220);
        margin-bottom: 1rem;


        &:focus{
            border: 1px solid rgb(0,208,255);
        }
    }



    button{
            cursor: pointer;
        &:focus{
            border:none;
        }
    }


    p{
        font-size: 14px;
        color: red;
    }
`






    const dispatch = useDispatch()
    const auth = useSelector((state)=>state.auth)
    const navigate = useNavigate()

    console.log(auth)




    useEffect(()=>{
      if(auth._id){
        navigate("/cart")
      }
    },[auth._id, navigate])

    const [user,setUser] = useState({
        name:"",
        email:"",
        password:""
    })


    const handleSubmit = (e)=>{
            e.preventDefault()

            dispatch(registerUser(user))
    }


  return (
    <>

    <StyleFrom  onSubmit={handleSubmit}>
        <h2>Register</h2>
        <input type='text' name='' placeholder='Name' onChange={(e)=>setUser({...user,name:e.target.value})}/>
        <input type='email' name='' placeholder='Email' onChange={(e)=>setUser({...user,email:e.target.value})}/>
        <input type='password' name='' autoComplete="on" placeholder='Password' onChange={(e)=>setUser({...user,password:e.target.value})}/>
        <button> {auth.registerStatus === "pending" ? "Submitting" : "Register"}</button>

        {auth.registerStatus === "rejected" ?  <p>{auth.registerError}</p> : null}
    </StyleFrom>

    </>
  )
}

export default Register
